import React from "react";
import UserItem from "./user-item";

// Have to include JS libraries like this
const SwipeableFlatList = require("react-native-swipeable-flat-list/src/index").SwipeableFlatList

const UserList = (props: any) => {
    return (
        <SwipeableFlatList
            data={props.users}
            bounceFirstRowOnMount={true}
            maxSwipeDistance={160}
            renderItem={UserItem}
            style={{height: 500}}
            // keyExtractor={(props, index) => index.toString()}
        />
    );
};

export default UserList;
